// src/Contact.js
import React from 'react';

function Contact() {
    return (
        <section className="contact">
            <h2>Contact</h2>
            <p>Email: your.email@example.com</p>
            <p>LinkedIn: linkedin.com/in/yourname</p>
            <p>GitHub: github.com/yourusername</p>
        </section>
    );
}

export default Contact;
